SELECT l_suppkey, l_partkey, l_orderkey, any_value(l_linenumber) AS l_linenumber, any_value(l_quantity) AS l_quantity, any_value(l_extendedprice) AS l_extendedprice, any_value(l_discount) AS l_discount, any_value(l_tax) AS l_tax, any_value(l_returnflag) AS l_returnflag, any_value(l_linestatus) AS l_linestatus, any_value(l_shipdate) AS l_shipdate, any_value(l_commitdate) AS l_commitdate, any_value(l_receiptdate) AS l_receiptdate, any_value(l_shipmode) AS l_shipmode FROM lineitem GROUP BY l_suppkey, l_partkey, l_orderkey OFFSET offset
